import React, { useEffect } from 'react';

const Home: React.FC = () => {
  useEffect((): void => {
    const seila = async () => {
      const response = await fetch(`https://api.github.com`);
      console.log(response);
    };
    seila();
  });
  return <h1>Hello World</h1>;
};

export default Home;
